import ReactDOM from "react-dom";
// import Main from './'
export default function Navbar() {
  return (
    <div>
      <div>
        <img src=".../images.react"/>
        <h1>ReactFacts</h1>
      </div>
      <h3>React Course - Project 1</h3>
    </div>
  );
}
